INSERT INTO `description` VALUES (1,'Don\'t be satisfied with less when you can have more - the budget-friendly Moto E 2nd Gen comes with an efficient quad-core processor, a long-lasting battery and Android Lollipop.','Brand : Motorola|Handset Color : Black|Form : Bar|Call Features : Loudspeaker|Model Name : Moto E (2nd Gen)|Touch Screen : Yes|SIM Type : Dual Sim, GSM + UMTS|Model ID : XT1506|In the Box : Handset with Built-in Battery, Charger, QSG and Warranty Card, Headset ','5 MP Primary Camera|4.5-inch TFT LCD Touchscreen|VGA Front Facing Camera|1.2 GHz Quad Core Processor|Wi-Fi Enabled|Expandable Storage Capacity of 32 GB|Android v5.0 (Lollipop) OS|Dual Sim (GSM + UMTS) '),(2,'Pure Style. Pure Performance. Pure Voice. Pure Simplicity. The all-new Moto X is here to captivate you with its aesthetically pleasing design and high-end technical features.','In the Box : Headset, Handset with Inbuilt Battery, User Manual, Charger|Brand : Motorola|Model Name : MOTO X (2nd Generation)|Model ID : XT1092|Form : Bar|SIM Size : Nano SIM|SIM Type : Single Sim, GSM|Touch Screen : Yes, Capacitive|Business Features : Document Viewer, Document Editor|Call Features : Loudspeaker|Handset Color : Black','2.5 GHz Qualcomm Snapdragon 801 MSM8974-AC Quad Core Processor|5.2-inch Capacitive Touchscreen|2 GB RAM|13 MP Primary Camera|Lollipop Upgrade Available as OTA Upgrade|Android v4.4.4 (KitKat) OS|2 MP Secondary Camera|Dual Ring LED Flash'),(3,'The Lenovo A6000 is a smartphone designed for multimedia and music lovers on a budget. It features a 5\" wide-view HD display that offers good resolution. It also has a Snapdragon quad core processor that delivers responsive system performance.','Brand : Lenovo|Handset Color : Black|Form : Bar|SIM Size : Micro SIM|Model Name : A6000|Touch Screen : Yes, Capacitive|SIM Type : Dual Sim, GSM LTE|Model ID : P0SB0001IN|In the Box : Battery, Headset, 2 Pin Wall Charger, USB Cable, Handset','5 inch HD IPS Display|1 GB RAM|Dual SIM|1.2 GHz Quad Core Qualcomm Snapdragon MSM8916 Processor|2 MP Secondary Camera|8 MP Primary Camera|Twin Speaker with Dolby Digital Plus|4G LTE'),(4,'The bigger the better - the Apple iPhone 6 is an exemplar of this phrase. The meticulously crafted iPhone 6 is truly an epitome of great taste and elegance.','Brand : Apple|Model Name : iPhone 6|Model ID : iPhone 6|Form : Bar|SIM Size : Nano SIM|SIM Type : Single Sim, GSM|Touch Screen : Yes|Business Features : Document Viewer, Microsoft Word, Microsoft Excel, Microsoft PowerPoint, PDF, PPT, PPTX, XLS, XLSX, TXT, DOC, DOCX|Call Features : Loudspeaker|Handset Color : Space Grey','1.2 MP Secondary Camera|4.7-inch Touchscreen|Bluetooth Support|Full HD Recording|iOS 8|8 MP Primary Camera|Wi-Fi Enabled'),(5,NULL,'Brand : HP|Model Name : Pavilion|Model ID : 15-p209TX|Color : Natural Silver|Lifestyle : Gaming','Intel Core i7|8 GB DDR3 RAM|1 TB HDD|Windows 8.1'),(6,'A budget friendly notebook, the Dell Inspiron 3541 delivers an efficient performance to keep you on the move throughout the day.','Brand : Dell|Series : 15|Model Name : Inspiron|Part Number : 3541E14500iB1|Model ID : 3541|Color	: Black|Lifestyle : Everyday Use','Others|4 GB DDR3 RAM|500 GB HDD|Windows 8.1'),(7,'The LG 42LB5820 is a full HD LED television with a 50 Hz screen refresh rate and smartshare feature that allows you to view videos and photos from other devices such as smartphones or hard drives','Motion Sensor : Yes|Display Size : 106 cm (42)|Brand : LG|Smart TV : Yes|Wi-Fi Type : Built-in Wi-Fi|USB : 3|HD Technology & Resolution : Full HD, 1920 x 1080|Model Name : 42LB5820|Built In Wi-Fi : Yes|3D : No|Screen Type : LED|HDMI : 3|Launch Year : 2014','LED Display|106 cm (42)|Full HD, 1920 x 1080|Smart TV|3 x HDMI, 3 x USB|Built-in Wi-Fi, Ethernet'),(8,'Experience great picture quality with whatever you intend on watching with Sony\'s X-Realityâ„¢ PRO image processing engine. It allows you to effortlessly explore internet contents.','Brand : Sony|Display Size : 80.1 cm (32)|Smart TV : Yes|Wi-Fi Type : Built-in Wi-Fi|USB : 2|HD Technology & Resolution : Full HD, 1920 x 1080|Series : W700B|Model Name : BRAVIA KDL-32W700B|3D : No|Built In Wi-Fi : Yes|Screen Type : LED|HDMI : 4|Launch Year : 2014','LED Display|80.1 cm (32)|Full HD, 1920 x 1080|Smart TV|4 x HDMI, 2 x USB|Built-in Wi-Fi'),(9,NULL,'Brand : Samsung|Display Size : 102 cm (40)|Smart TV : No|USB : 2|HD Technology & Resolution : HD Ready, 1366 x 768|Model Name : 40H4240|Series : 4|3D : No|Screen Type : LED|HDMI : 2','LED Display|102 cm (40)|HD Ready, 1366 x 768|2 x HDMI, 2 x USB'),(10,'Green knitted printed basketball T-shirt, engineered with DRI-FIT technology, has a ribbed round neck, short sleeves with branding on the left sleeve, DRI-FIT branding above the hem on the right side. Warranty: 6 months against manufacturing defects (not valid on products with more than 20% discount). Get the ultimate in comfort and style with this awesome printed basketball t-shirt from Nike. Engineered with DRI-FIT technology, this t-shirt removes sweat and keeps you dry and comfortable. Team it up with a pair of shorts and sports shoes for an admirable casual look.','Sleeve : Half Sleeve|Number of Contents in Sales Package : Pack of 1|Fabric : 58% Cotton, 42% Polyester|Type : Round Neck|Fit : Regular Fit|Pattern : Printed|Occasion : Casual|Ideal For : Men\'s',NULL),(11,NULL,'Sleeve : Half Sleeve|Fabric : Cotton|Type : Round Neck|Design : Transfer Print at Front|Pattern : Printed|Occasion : Casual|Ideal For : Men\'s',NULL),(12,NULL,'Closure : Buttoned|Fabric : Cotton, Poly, Spandex|Pockets : 1 Coin Pocket, 2 Curved Pockets, 2 Patch Pockets at Back|Fit : Slim|Belt Loops : Yes|Fly : Zipper|Pattern : Solid|Occasion  : Casual|Ideal For : Men\'s',NULL),(13,NULL,'Pattern : Solid|Ideal For : Men\'s|Occasion : Formal|Pleats : Box Pleat at Back|Sleeve : Full Sleeve|Brand Fit : Slim Fit|Fabric : Cotton|Collar : Spread Collar|Pockets : Patch Pocket on Chest|Fit : Slim|Placket : Full Button Down Placket|Cuff : Curved Cuffs',NULL),(14,NULL,'Closure : Button|Fabric : 100% Cotton|Pockets : 2 Curved Pockets at Front, 2 Patch Pockets at Back, 1 Coin Pocket|Fit : Regular|Belt Loops : Yes|Fly : Zipper|Pattern : Solid|Ideal For : Men\'s',NULL),(15,NULL,'Pleats : Flat Front|Closure : Drawstrings|Fabric : 100% Cotton|Type : Sports Shorts|Waistband : Elastic|Pockets : 1 Coin Pocket at Front, 2 Curved Pockets at Front, 1 Patch Pocket at Back|Pattern : Solid|Occasion : Sports|Ideal For : Men\'s',NULL),(16,'Flaunt the sporty design of this Fastrack Explorer Analog Watch wearing it with your favourite pair of cargos and a white cotton tee. An ideal casual wear, this watch is perfect while you go travelling or even on a weeking for a catch-up with friends.','Type : Analog|Series : Explorer|Style Code : 9463AL08|Ideal For : Men|Diameter : 45 mm|Weight : 42 g|Thickness : 11 mm','Round Dial|Black Strap|Water Resistant|Buckle Clasp'),(17,'For the adventurous men, Casio has brought Analog-Digital G-Shock watches that are sturdy and durable.','Type : Analog-Digital|Series : G-Shock|Style Code : G271|Occasion : Sports|Ideal For : Men|Power Source : Battery Powered','Black Strap|Buckle Clasp|Resin Case|Water Resistant|Round Dial'),(18,'Feel empowered whenever you step out of your house as the Titan HTSE 3 analog watch exudes both elegance and class in terms of design and functionality.','Mechanism : Quartz|Type : AnalogSeries : HTSE 3|Style Code : 1635KP03|Ideal For : Men|Power Source : Light Powered|Set Content : Warranty Card','Square Dial|Black Strap|Water Resistant|Stainless Steel Case'),(19,'Old is gold, and that is exactly how Reebok feels, especially with their Classics Leather Vintage sneakers. Featuring suede exteriors of blue, steel grey and black, these sneakers can be well on their way to creating a buzz about your style, especially when teamed with cargo pants and a blue polo neck tee. They also come with cushioned ankles for that comfortable stride along your high end streets.','Ideal For : Men|Occasion : Casual|Closure : Laced|Tip Shape : Round|Weight : 263 gm (per single Shoe) - Weight of the product may vary depending on size.|Style : Panel and Stitch Detail, Suede and Cut Work Detail on Body|Color : Blue, Steel, Black',NULL),(20,'Every gentleman needs a pair of tan coloured shoes to bring an earthy charm to neutral toned ensembles, for that unquestionable classy 40â€™s style. These stylish corporate boots are perfect for that Sunday at the derby as the panel and stitch detailed body is sure to attract more than a few gazes. The Lee Cooper Boots have been crafted from genuine leather with a cushioned footbed, for complaint-free wear even on those long afternoons at the racetrack.','Ideal For : Men|Occasion : Casual|Sole Material : TPR|Closure : Laced|Inner Material : Fabric|Heel Height : 1.25 inch|Style : Panel and Stitch Detail on Body|Material : Leather, Rubber|Outer Material : Genuine Leather|Design : Logo on Side|Color : Tan',NULL),(21,NULL,'Ideal For : Men|Occasion : Sports|Closure : Laced|Tip Shape : Round|Weight : 231 gm (per single Shoe) - Weight of the product may vary depending on size.|Style : Panel and Stitch Detail, Perforations on Body, Loop at Back|Color : Black, Green',NULL),(22,NULL,'Ideal For : Men|Occasion : Sports|Closure : Laced|Tip Shape : Round|Weight : 176 gm (per single Shoe) - Weight of the product may vary depending on size.|Style : Panel and Stitch Detail, Cut Work Detail|Design : Logo Detail on Footbed|Color : White',NULL),(23,'The material of saree is Cotton and the total length of saree is 6.3 meters including unstitch blouse piece.','Pattern : Printed|Occasion : Casual|Region : Other|Fabric : Cotton|Type : Fashion|Blouse Piece : Yes','With Blouse Piece|Fashion Sari|Cotton|Red'),(24,'This intricately weaved saree in colour blue will definitely add a touch of elegance to your smart personality. It showcases an in-trend floral print all over that will beguile you at the very first glance. Sheer in aesthetics, this silk made attire when mixed and matched with a diamond pendant set would stand stellar. This six yard wonder designed by National Awardee Peer Mohammad Ansari comes with the advantage of a matching blouse piece. Its handloom mark no is 1130001818. About Banarasi Saree An integral part of Indian bride?s trousseau, intricate Banarasi saree completes her grace when worn with solah sringar. Since ancient times, this religious city and a centre of brocade-weaving started producing lavish drapes, that got a strong foothold in global market. Banarasi sarees are majorly worn during weddings, festivals, and grand festivities. Jangla, Tanchoi, Vaskat, Cutwork, Tishu, and Butidar are among exclusive varieties of Banarasi sarees. The drapes are further enhanced through rich craftsmanship and are made of silk warp and silk weft, on plain ground base, brocaded in multiple layouts introducing buties, bells, creepers, and buttas. Special characteristics are Mughal inspired designs of intertwining floral and foliate motifs, kalga and bel, a string of upright leaves called jhallar, edge of border. Other meticulous features include gold work, compact weaving, figures with small details, metallic visual effects, pallus, jal (a net like pattern), and mina work. Normally, three artisans are required to give shape and form to a Banarasi saree but may take a time span of 15 days to six months, depending upon the intricacy required. Till today, Banarasi sarees continue to contribute the most in the history of Indian clothing. Weaver\'s Information Established to the delight of every woman, Jamdani Handloom Weavers Co. Society Ltd. is a name par excellence in the production of sarees.','Pattern : Self Design|Occasion : Festive, Wedding, Party|Fabric : Cotton|Type : Banarasi|Blouse Piece : Yes','With Blouse Piece|Banarasi Sari|Cotton|Multicolor'),(25,'add an ethnic to your everday casuals or office wear with this plain solid pink kurti from GMI','Sleeve : 3/4 Sleeve|Number of Contents in Sales Package : Pack of 1|Fabric : Georgette|Pattern : Printed|Ideal For : Women\'s|Occasion : Casual','BLACK'),(26,NULL,'Sleeve : Full Sleeve|Number of Contents in Sales Package : 1|Kurta Type : Long suit|Type : long suit|Dupatta Type : PURE SHIFFON|Kurta Fabric : Georgette and Net|Pattern : Embroidered|Ideal For : Women\'s|Occasion : Casual, Party, Wedding','Glitzy latest|Karishma kapoor|semi stiched|salwar suit'),(27,'The pair of Casual Flats are must have all womens to complement your attire.','Ideal For : Women|Occasion : Casual|Sole Material : Sheet|Number of Contents in Sales Package : Pack of 1|Type : Flats|Inner Material : Synthetic|Outer Material : Synthetic|Insole Material : PVC|Color : Beige',NULL),(28,NULL,'Ideal For : Women|Tip Shape : Round|Closure : Buckle|Weight : 180 gm (per single Sandal) - Weight of the product may vary depending on size.|Type : Heels|Heel Height : 3|Style : Panel and Stitch Detail, Applique Detail|Heel Type : Pointed|Color : Rose Nude|Design : Logo Print',NULL),(29,NULL,'Ideal For : Women|Tip Shape	 : Round|Weight : 64 gm (per single Slipper) - Weight of the product may vary depending on size.|Type : Flip Flops|Style : Panel and Stitch Detail|Color : Pink, Purple, White|Design : Logo Print, Print Detail',NULL),(30,NULL,'Closure : Turnlock|Type : Satchel|Style Code : 8903439331962|Ideal For : Women|Color Code : Prussia and Brown',NULL),(31,NULL,'Closure : Magnetic Button|Type : Sling Bag|Material : Canvas|Style Code : BBW-402|Ideal For : Women|Bag Size : Medium|Occasion : Casual|Color Code : Cream','100 % Canvas & PU|Contrast Lining|Trendy & Stylish|Sling Crossbody Bag'),(32,NULL,'Closure : Zip, Magnetic Snap|Type : Sling Bag|Style Code : AHBG315W089|Ideal For : Women|Color Code : Beige',NULL),(33,NULL,'Closure : Flap with Press Button|Style Code : 7267602|Ideal For : Women|Color Code : Rosso Corsa','Flap with Press Button Closure|Ideal for Women|10 Card Slots|3 Compartments|Textured and Quilted Design'),(34,'Be it the design, the perfo